import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  return (
    <>
      <IndexNavbar />

      <div style={containerStyle}>
        {/* En-tête */}
        <div style={headerStyle}>
          <h1 style={bankTitleStyle}>3TDBANK</h1>
          <div style={separatorStyle}></div>
        </div>

        {/* Liste des tickets */}
        <div style={ticketsContainer}>
          <div style={ticketItem}>
            <h2 style={ticketTitle}>Problème d'accès au portail client</h2>
            <div style={ticketDetails}>
              <span style={departmentStyle}>Support technique</span>
              <span style={dateStyle}>2024-05-19</span>
            </div>
          </div>

          <div style={separatorStyle}></div>

          <div style={ticketItem}>
            <h2 style={ticketTitle}>Question sur un virement international</h2>
            <div style={ticketDetails}>
              <span style={departmentStyle}>Questions bancaire</span>
              <span style={dateStyle}>2024-05-14</span>
            </div>
          </div>

          <div style={separatorStyle}></div>

          <div style={ticketItem}>
            <h2 style={ticketTitle}>Carte bloquée à l'étranger</h2>
            <div style={ticketDetails}>
              <span style={departmentStyle}>Carte Bancaire</span>
              <span style={dateStyle}>2024-05-10</span>
            </div>
          </div>
        </div>

        {/* Section inférieure */}
        <div style={footerSection}>
          <div style={footerSeparator}></div>
          <h3 style={myTicketsTitle}>Mes Tickets</h3>
          <div style={statusContainer}>
            <span style={statusItem}>Quart</span>
            <span style={statusItem}>Gratuit</span>
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// Styles
const containerStyle = {
  maxWidth: "800px",
  margin: "0 auto",
  padding: "20px",
  fontFamily: "Arial, sans-serif",
};

const headerStyle = {
  textAlign: "center",
  marginBottom: "40px",
};

const bankTitleStyle = {
  fontSize: "2.5em",
  fontWeight: "300",
  margin: "20px 0",
  color: "#333",
};

const separatorStyle = {
  height: "2px",
  backgroundColor: "#ccc",
  width: "80%",
  margin: "20px auto",
};

const ticketsContainer = {
  backgroundColor: "#fff",
  borderRadius: "5px",
  padding: "20px",
};

const ticketItem = {
  margin: "25px 0",
};

const ticketTitle = {
  fontSize: "1.4em",
  fontWeight: "400",
  margin: "0 0 10px 0",
  color: "#444",
};

const ticketDetails = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
};

const departmentStyle = {
  fontSize: "0.95em",
  color: "#666",
};

const dateStyle = {
  fontSize: "0.9em",
  color: "#888",
};

const footerSection = {
  textAlign: "center",
  marginTop: "40px",
};

const footerSeparator = {
  ...separatorStyle,
  width: "60%",
  margin: "40px auto",
};

const myTicketsTitle = {
  fontSize: "1.8em",
  fontWeight: "300",
  margin: "20px 0",
  color: "#333",
};

const statusContainer = {
  display: "flex",
  justifyContent: "center",
  gap: "40px",
  margin: "20px 0",
};

const statusItem = {
  fontSize: "1.2em",
  color: "#555",
  fontWeight: "300",
};

export default MyTickets;
